import React, { useState } from "react";



const App = () => {
    const times = new Date();
times.toDateString();
    const [time, setCount] = useState(0) 
    const inc = () => {
        setCount(time + 1)
    }
    return(
        <>
            <h1>{time}</h1>
            <button onClick={inc}> Get Time </button> 
        </>
    )
}

export default App;
